import React from "react";
import "./App.css";
import Carousel from "./components/carousel";
import "react-loader-spinner/dist/loader/css/react-spinner-loader.css";

function App() {
  return (
    <>
    <Loader
    type="Puff"
    color="#00BFFF"
    height={100}
    width={100}
    timeout={3000} //3 secs

 />

    <div className="App">
      <Carousel></Carousel>
    </div>
    </>
  );
}

export default App;
